  false,\n\t\"url\": null,\n\t\"notes\": \"An Erosion and Sediment Control Facility
  is a DEP primary facility type related to the Water Pollution Control program. The
  following sub-facility types related to Erosion and Sediment Control Facilities
  are included: Agricultural Activities Commercial or Industrial Development Government
  Facilities Oil and Gas Development Private Road or Residence Public Road Construction
  Recreational Activities Remediation/Restoration Residential Subdivision Sewerage
  or Water Systems Silviculture Utility Facility and/or Transmission Line Any of the
  above development activities that may discharge stormwater during construction fall
  under the erosion and sediment control permit category.\",\n\t\"license_title\":
